import pic1 from './pic1.jpeg';
import './App.css';
import $ from 'jquery';
import React from 'react';


$(function () {
  var element = $("#App");
  $(window).scroll(function () {
    if($(window).scrollTop() > 100) {
      element.addClass("animation2");
    }
    else{
      element.removeClass("animation2")
    }

  });
});





function App() {
  return (
  <>
      <div id="App" className="sticky"  ></div>

      <div id ="picture" className="sticky"><img id ='picture1' src={pic1} alt="picture1" /></div>
  </>
  );
}



export default App;
